p=A.D(["title","Black Rat","titleAR","\u0627\u0644\u062c\u0631\u0630 \u0627\u0644\u0623\u0633\u0648\u062f","contentAR","\u0627\u0644\u062c\u0631\u0630 \u0627\u0644\u0623\u0633\u0648\u062f \u060c \u0627\u0644\u0645\u0639\u0631\u0648\u0641 \u0623\u064a\u0636\u064b\u0627 \u0628\u0627\u0633\u0645 \u062c\u0631\u0630 \u0627\u0644\u0633\u0642\u0641 \u060c \u0623\u0648 \u062c\u0631\u0630 \u0627\u0644\u0633\u0641\u064a\u0646\u0629 \u060c \u0623\u0648 \u0627\u0644\u062c\u0631\u0630 \u0627\u0644\u0645\u0646\u0632\u0644\u064a \u060c \u0647\u0648 \u0623\u062d\u062f \u0627\u0644\u0642\u0648\u0627\u0631\u0636 \u0637\u0648\u064a\u0644\u0629 \u0627\u0644\u0630\u064a\u0644 \u0627\u0644\u0634\u0627\u0626\u0639\u0629 \u0645\u0646 \u062c\u0646\u0633 \u0627\u0644\u062c\u0631\u0630 \u0627\u0644\u0646\u0645\u0637\u064a Rattus \u060c \u0641\u064a \u0627\u0644\u0641\u0635\u064a\u0644\u0629 \u0627\u0644\u0641\u0631\u0639\u064a\u0629 Murinae. \u0645\u0646 \u0627\u0644\u0645\u062d\u062a\u0645\u0644 \u0623\u0646\u0647 \u0646\u0634\u0623 \u0641\u064a \u0634\u0628\u0647 \u0627\u0644\u0642\u0627\u0631\u0629 \u0627\u0644\u0647\u0646\u062f\u064a\u0629 \u060c \u0648\u0644\u0643\u0646\u0647 \u0645\u0648\u062c\u0648\u062f \u0627\u0644\u0622\u0646 \u0641\u064a \u062c\u0645\u064a\u0639 \u0623\u0646\u062d\u0627\u0621 \u0627\u0644\u0639\u0627\u0644\u0645. ","content","The black rat, also known as the roof rat, ship rat, or house rat, is a common long-tailed rodent of the stereotypical rat genus Rattus, in the subfamily Murinae. It likely originated in the Indian subcontinent, but is now found worldwide.","color",p[B.aN.fc(5)],"image","assets/images/Black rat.jpg"],a1,a2)
