m=A.D(["title","Common Pochard","titleAR","\u0628\u0648\u0634\u0627\u0631 \u0627\u0644\u0645\u0634\u062a\u0631\u0643\u0629 ","contentAR","\u0627\u0644\u0628\u0633\u062a\u0627\u0646 \u0627\u0644\u0634\u0627\u0626\u0639 \u0647\u0648 \u0628\u0637\u0629 \u063a\u0648\u0635 \u0645\u062a\u0648\u0633\u0637\u0629 \u0627\u0644\u062d\u062c\u0645. \u0627\u0644\u0627\u0633\u0645 \u0627\u0644\u0639\u0644\u0645\u064a \u0645\u0634\u062a\u0642 \u0645\u0646 \u0627\u0644\u064a\u0648\u0646\u0627\u0646\u064a\u0629 aithuia \u0648\u0647\u0648 \u0637\u0627\u0626\u0631 \u0628\u062d\u0631\u064a \u063a\u064a\u0631 \u0645\u0639\u0631\u0648\u0641 \u0630\u0643\u0631\u0647 \u0627\u0644\u0645\u0624\u0644\u0641\u0648\u0646 \u0628\u0645\u0627 \u0641\u064a \u0630\u0644\u0643 Hesychius \u0648 Aristotle \u060c \u0648\u0627\u0644\u0644\u0627\u062a\u064a\u0646\u064a\u0629 ferina \u060c 'wild game' \u060c \u0645\u0646 ferus \u060c 'wild' ","content","The common pochard is a medium-sized diving duck. The scientific name is derived from Greek aithuia an unidentified seabird mentioned by authors including Hesychius and Aristotle, and Latin ferina, 'wild game', from ferus, 'wild'","color",m[B.aN.fc(5)],"image","assets/images/Common Pochard.jpg"],a1,a2)
